import { UserManager } from "./Classes/Managers/UserManager.js";
import mongoose from "mongoose";
export default class DiscordXP {
    users;
    /**
     * Initialize the discord.xp package
     * @param {string} url
     */
    constructor(url) {
        if (!url)
            throw new TypeError("A MongoDB URL was not provided");
        this.users = new UserManager();
        setTimeout(() => mongoose.connect(url), 1000);
    }
}
